import React from 'react';


function cards(props) {
    
    return(

        <div>
            <div>
                <h2>Netflix Orginial Series</h2>
                <img src={props.imgsrc } alt="mypic"/>
                <h3>{props.sname}</h3>
            </div>
            </div>
     
    )
}
export default cards;
